import React from 'react';
import './Owner.css';
import YouTube from "react-youtube";

function Header() {
  const options = {
    width: "400",
    height: "300",
    playerVars: {
      autoplay: 1,
    },
  };

  const playlists = [
    { title: 'MY Daily Mix 1', description: '힙합, 발라드, 댄스곡', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'MY Daily Mix 2', description: '팝, 알앤비, 재즈', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'MY Daily Mix 3', description: '락, 메탈, 클래식', imageUrl: 'https://via.placeholder.com/150' },
    { title: 'MY Daily Mix 4', description: '인디, 어쿠스틱, 로파이', imageUrl: 'https://via.placeholder.com/150' },
  ];



  return (
    <div className = "Header">

      <div className="header-container">
        <h1 className="logo">SoundPIn</h1>
        <input className="search-bar" type="text" placeholder="Search using Pin..." />
      </div>

      <div className="profile-container">
        <img className="profile-image" src="https://via.placeholder.com/80" alt="Profile" />
          <div className="profile-details">
          <h2 className="profile-name">정해인 잘생겼다</h2>
          <p className="bio">안녕~! < br /> 노래는 기분에 맞춰 들어야지! <br /> 기분전환이 필요하다면 내 스따일~ ^^</p>
          </div>
      </div>

      <div className="playlist-container">
        {playlists.map((playlist, index) => (
          <div className="playlist-card" key={index}>

            <YouTube videoId="hiMoy4pyAl0" opts={options} src={playlist.imageUrl} alt={playlist.title} />
            <YouTube videoId="75kySTFaBQQ" opts={options} src={playlist.imageUrl} alt={playlist.title} />
            <YouTube videoId="bE5mXQc7BAY" opts={options} src={playlist.imageUrl} alt={playlist.title} />
            <YouTube videoId="KQVJKPQc3Tg" opts={options} src={playlist.imageUrl} alt={playlist.title} />
            <h3 className="playlist-title">{playlist.title}</h3>
            <p className="playlist-description">{playlist.description}</p>
          </div>
        ))}
      </div>

    </div>

  );
}

export default Header;
